import React, { useState } from 'react';

interface TrackerProps {
  days: any[];
  setDays: React.Dispatch<React.SetStateAction<any[]>>;
}

const Tracker: React.FC<TrackerProps> = ({ days, setDays }) => {
  const [steps, setSteps] = useState('');
  const [calories, setCalories] = useState('');
  const [water, setWater] = useState('');
  const [workout, setWorkout] = useState('');
  const [height, setHeight] = useState('');
  const [weight, setWeight] = useState('');
  const [heartRate, setHeartRate] = useState('');
  const [sleep, setSleep] = useState('');
  const [stride, setStride] = useState('');
  const [editIdx, setEditIdx] = useState<number | null>(null);

  const bmi =
    height && weight
      ? (parseFloat(weight) / ((parseFloat(height) / 100) ** 2)).toFixed(2)
      : '';

  const distance =
    steps && stride
      ? ((parseFloat(steps) * parseFloat(stride)) / 100000).toFixed(2)
      : '';

  const handleConfirm = () => {
    if (editIdx !== null) {
      const updatedDays = [...days];
      updatedDays[editIdx] = {
        steps,
        stride,
        calories,
        water,
        workout,
        height,
        weight,
        heartRate,
        sleep,
        bmi: bmi || '0',
        distance: distance || '0',
      };
      setDays(updatedDays);
      setEditIdx(null);
    } else {
      setDays([
        ...days,
        {
          steps,
          stride,
          calories,
          water,
          workout,
          height,
          weight,
          heartRate,
          sleep,
          bmi: bmi || '0',
          distance: distance || '0',
        },
      ]);
    }
    setSteps('');
    setStride('');
    setCalories('');
    setWater('');
    setWorkout('');
    setHeight('');
    setWeight('');
    setHeartRate('');
    setSleep('');
  };

  // Edit handler: load selected day into form
  React.useEffect(() => {
    if (editIdx !== null && days[editIdx]) {
      const day = days[editIdx];
      setSteps(day.steps);
      setStride(day.stride);
      setCalories(day.calories);
      setWater(day.water);
      setWorkout(day.workout);
      setHeight(day.height);
      setWeight(day.weight);
      setHeartRate(day.heartRate);
      setSleep(day.sleep);
    }
  }, [editIdx, days]);

  return (
    <div className="tracker">
      <h2>Fitness Tracker</h2>
      <label>
        Steps:
        <input type="number" value={steps === '' ? undefined : steps} onChange={e => setSteps(e.target.value)} placeholder="Enter steps" />
      </label>
      <label>
        Stride Length (cm):
        <input type="number" value={stride === '' ? undefined : stride} onChange={e => setStride(e.target.value)} placeholder="Enter stride length" />
      </label>
      <label>
        Calories:
        <input type="number" value={calories === '' ? undefined : calories} onChange={e => setCalories(e.target.value)} placeholder="Enter calories" />
      </label>
      <label>
        Water Intake (L):
        <input type="number" value={water === '' ? undefined : water} onChange={e => setWater(e.target.value)} placeholder="Enter water intake" />
      </label>
      <label>
        Workout Time (min):
        <input type="number" value={workout === '' ? undefined : workout} onChange={e => setWorkout(e.target.value)} placeholder="Enter workout time" />
      </label>
      <label>
        Weight (kg):
        <input type="number" value={weight === '' ? undefined : weight} onChange={e => setWeight(e.target.value)} placeholder="Enter weight" />
      </label>
      <label>
        Height (cm):
        <input type="number" value={height === '' ? undefined : height} onChange={e => setHeight(e.target.value)} placeholder="Enter height" />
      </label>
      <label>
        Heart Rate (bpm):
        <input type="number" value={heartRate === '' ? undefined : heartRate} onChange={e => setHeartRate(e.target.value)} placeholder="Enter heart rate" />
      </label>
      <label>
        Sleep Hours:
        <input type="number" value={sleep === '' ? undefined : sleep} onChange={e => setSleep(e.target.value)} placeholder="Enter sleep hours" />
      </label>
      <button onClick={handleConfirm} style={{ marginTop: '1rem' }}>
        {editIdx !== null ? 'Update' : 'Confirm'}
      </button>
    </div>
  );
};

export default Tracker;
